import React from "react";
import { Switch, Route } from "react-router";
import Navs from "./components/Navs";

const App = () => {
  return (
    <div>
      <Navs />
      <Switch>
        <Route exact path="/">
          This is home page
        </Route>
        <Route path="/about">This is about page</Route>
        <Route>not found</Route>
      </Switch>
    </div>
  );
};

export default App;
